//import profil from "../img/profil.png"


function navbar(){
    return (
        <div style={{padding:"10px", borderBottom:""}}>
            <Grid container>
                <Grid item xs={6}>
                    //<img style={{width: "30px", marginleft:"80px"}} src={linkedin}/>
                    //<img style={{width: "30px", marginleft:"20px"}} src={loupe}/>
                </Grid>
                <Grid item xs={6}>
                    <img style={{width: "30px", marginleft:"20px"}} src={Home}/>
                    //<img style={{width: "30px", marginleft:"20px"}} src={reseau}/>
                    //<img style={{width: "30px", marginleft:"20px"}} src={messag}/>
                    //<img style={{width: "30px", marginleft:"20px" }} src={profil}/>
                </Grid>

            </Grid>
        </div>
    )
}

export default navbar;
